import React, { useState, useRef, useEffect } from "react";

const Navbar = () => {
  const [profileDropdown, setProfileDropdown] = useState(false);
  const [messageDropdown, setMessageDropdown] = useState(false);
  const [notificationDropdown, setNotificationDropdown] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");

  const profileRef = useRef(null);
  const messageRef = useRef(null);
  const notificationRef = useRef(null);

  // Close dropdowns when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (profileRef.current && !profileRef.current.contains(event.target)) {
        setProfileDropdown(false);
      }
      if (messageRef.current && !messageRef.current.contains(event.target)) {
        setMessageDropdown(false);
      }
      if (notificationRef.current && !notificationRef.current.contains(event.target)) {
        setNotificationDropdown(false);
      }
    };

    document.addEventListener("mousedown", handleClickOutside);
    return () => document.removeEventListener("mousedown", handleClickOutside);
  }, []);

  // Toggle sidebar
  const handleToggleSidebar = () => {
    document.body.classList.toggle("sidebar-icon-only");
  };

  // Toggle mobile sidebar
  const handleMobileToggle = () => {
    const sidebar = document.querySelector(".sidebar");
    if (sidebar) {
      sidebar.classList.toggle("active");
    }
  };

  // Fullscreen toggle
  const handleFullscreen = () => {
    if (
      (document.fullScreenElement !== undefined && document.fullScreenElement === null) ||
      (document.msFullscreenElement !== undefined && document.msFullscreenElement === null) ||
      (document.mozFullScreen !== undefined && !document.mozFullScreen) ||
      (document.webkitIsFullScreen !== undefined && !document.webkitIsFullScreen)
    ) {
      if (document.documentElement.requestFullScreen) {
        document.documentElement.requestFullScreen();
      } else if (document.documentElement.mozRequestFullScreen) {
        document.documentElement.mozRequestFullScreen();
      } else if (document.documentElement.webkitRequestFullScreen) {
        document.documentElement.webkitRequestFullScreen();
      } else if (document.documentElement.msRequestFullscreen) {
        document.documentElement.msRequestFullscreen();
      }
    } else {
      if (document.cancelFullScreen) {
        document.cancelFullScreen();
      } else if (document.mozCancelFullScreen) {
        document.mozCancelFullScreen();
      } else if (document.webkitCancelFullScreen) {
        document.webkitCancelFullScreen();
      } else if (document.msExitFullscreen) {
        document.msExitFullscreen();
      }
    }
  };

  // Handle search
  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim()) {
      console.log("Searching for:", searchQuery);
      // Add your search logic here
    }
  };

  // Handle signout
  const handleSignout = () => {
    console.log("Signing out...");
    // Add your signout logic here
    // e.g., clear tokens, redirect to login
    window.location.href = "/admin/login";
  };

  // Messages data
  const messages = [
    { id: 1, image: "/admin-assets/images/faces/face4.jpg", name: "Mark", text: "sent you a message", time: "1 Minutes ago" },
    { id: 2, image: "/admin-assets/images/faces/face2.jpg", name: "Cregh", text: "sent you a message", time: "15 Minutes ago" },
    { id: 3, image: "/admin-assets/images/faces/face3.jpg", name: "Profile", text: "picture updated", time: "18 Minutes ago" }
  ];

  // Notifications data
  const notifications = [
    { id: 1, icon: "mdi-calendar", iconBg: "bg-success", title: "Event today", text: "Just a reminder that you have an event today" },
    { id: 2, icon: "mdi-cog", iconBg: "bg-warning", title: "Settings", text: "Update dashboard" },
    { id: 3, icon: "mdi-link-variant", iconBg: "bg-info", title: "Launch Admin", text: "New admin wow!" }
  ];

  return (
    <nav className="navbar default-layout-navbar col-lg-12 col-12 p-0 fixed-top d-flex flex-row">
      <div className="text-center navbar-brand-wrapper d-flex align-items-center justify-content-start">
        <a className="navbar-brand brand-logo" href="/admin">
          <img src="/admin-assets/images/logo.svg" alt="logo" />
        </a>
        <a className="navbar-brand brand-logo-mini" href="/admin">
          <img src="/admin-assets/images/logo-mini.svg" alt="logo" />
        </a>
      </div>

      <div className="navbar-menu-wrapper d-flex align-items-stretch">
        <button
          className="navbar-toggler navbar-toggler align-self-center"
          type="button"
          onClick={handleToggleSidebar}
        >
          <span className="mdi mdi-menu"></span>
        </button>

        <div className="search-field d-none d-md-block">
          <form className="d-flex align-items-center h-100" onSubmit={handleSearch}>
            <div className="input-group">
              <div className="input-group-prepend bg-transparent">
                <i className="input-group-text border-0 mdi mdi-magnify"></i>
              </div>
              <input
                type="text"
                className="form-control bg-transparent border-0"
                placeholder="Search projects"
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
              />
            </div>
          </form>
        </div>

        <ul className="navbar-nav navbar-nav-right">
          {/* Profile Dropdown */}
          <li className="nav-item nav-profile dropdown" ref={profileRef}>
            <button
              className="nav-link dropdown-toggle btn btn-link"
              onClick={() => {
                setProfileDropdown(!profileDropdown);
                setMessageDropdown(false);
                setNotificationDropdown(false);
              }}
              style={{ background: "none", border: "none" }}
            >
              <div className="nav-profile-img">
                <img src="/admin-assets/images/faces/face1.jpg" alt="profile" />
                <span className="availability-status online"></span>
              </div>
              <div className="nav-profile-text">
                <p className="mb-1 text-black">David Greymaax</p>
              </div>
            </button>

            <div className={`dropdown-menu navbar-dropdown ${profileDropdown ? "show" : ""}`}>
              <a className="dropdown-item" href="#activity">
                <i className="mdi mdi-cached me-2 text-success"></i>
                Activity Log
              </a>
              <div className="dropdown-divider"></div>
              <button className="dropdown-item" onClick={handleSignout}>
                <i className="mdi mdi-logout me-2 text-primary"></i>
                Signout
              </button>
            </div>
          </li>

          {/* Fullscreen */}
          <li className="nav-item d-none d-lg-block full-screen-link">
            <button className="nav-link btn btn-link" onClick={handleFullscreen} style={{ background: "none", border: "none" }}>
              <i className="mdi mdi-fullscreen" id="fullscreen-button"></i>
            </button>
          </li>

          {/* Messages Dropdown */}
          <li className="nav-item dropdown" ref={messageRef}>
            <button
              className="nav-link count-indicator dropdown-toggle btn btn-link"
              onClick={() => {
                setMessageDropdown(!messageDropdown);
                setProfileDropdown(false);
                setNotificationDropdown(false);
              }}
              style={{ background: "none", border: "none" }}
            >
              <i className="mdi mdi-email-outline"></i>
              <span className="count-symbol bg-warning"></span>
            </button>

            <div className={`dropdown-menu dropdown-menu-end navbar-dropdown preview-list ${messageDropdown ? "show" : ""}`}>
              <h6 className="p-3 mb-0">Messages</h6>
              <div className="dropdown-divider"></div>

              {messages.map((msg) => (
                <React.Fragment key={msg.id}>
                  <a className="dropdown-item preview-item" href="#message">
                    <div className="preview-thumbnail">
                      <img src={msg.image} alt="msg" className="profile-pic" />
                    </div>
                    <div className="preview-item-content d-flex align-items-start flex-column justify-content-center">
                      <h6 className="preview-subject ellipsis mb-1 font-weight-normal">
                        {msg.name} {msg.text}
                      </h6>
                      <p className="text-gray mb-0">{msg.time}</p>
                    </div>
                  </a>
                  <div className="dropdown-divider"></div>
                </React.Fragment>
              ))}

              <h6 className="p-3 mb-0 text-center">
                <a href="#all-messages">4 new messages</a>
              </h6>
            </div>
          </li>

          {/* Notifications Dropdown */}
          <li className="nav-item dropdown" ref={notificationRef}>
            <button
              className="nav-link count-indicator dropdown-toggle btn btn-link"
              onClick={() => {
                setNotificationDropdown(!notificationDropdown);
                setProfileDropdown(false);
                setMessageDropdown(false);
              }}
              style={{ background: "none", border: "none" }}
            >
              <i className="mdi mdi-bell-outline"></i>
              <span className="count-symbol bg-danger"></span>
            </button>

            <div className={`dropdown-menu dropdown-menu-end navbar-dropdown preview-list ${notificationDropdown ? "show" : ""}`}>
              <h6 className="p-3 mb-0">Notifications</h6>
              <div className="dropdown-divider"></div>

              {notifications.map((notif) => (
                <React.Fragment key={notif.id}>
                  <a className="dropdown-item preview-item" href="#notification">
                    <div className="preview-thumbnail">
                      <div className={`preview-icon ${notif.iconBg}`}>
                        <i className={`mdi ${notif.icon}`}></i>
                      </div>
                    </div>
                    <div className="preview-item-content d-flex align-items-start flex-column justify-content-center">
                      <h6 className="preview-subject font-weight-normal mb-1">{notif.title}</h6>
                      <p className="text-gray ellipsis mb-0">{notif.text}</p>
                    </div>
                  </a>
                  <div className="dropdown-divider"></div>
                </React.Fragment>
              ))}

              <h6 className="p-3 mb-0 text-center">
                <a href="#all-notifications">See all notifications</a>
              </h6>
            </div>
          </li>

          {/* Power/Logout */}
          <li className="nav-item nav-logout d-none d-lg-block">
            <button className="nav-link btn btn-link" onClick={handleSignout} style={{ background: "none", border: "none" }}>
              <i className="mdi mdi-power"></i>
            </button>
          </li>

          {/* Settings */}
          <li className="nav-item nav-settings d-none d-lg-block">
            <a className="nav-link" href="#settings">
              <i className="mdi mdi-format-line-spacing"></i>
            </a>
          </li>
        </ul>

        <button
          className="navbar-toggler navbar-toggler-right d-lg-none align-self-center"
          type="button"
          onClick={handleMobileToggle}
        >
          <span className="mdi mdi-menu"></span>
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
